import React from 'react'
import './About.css'
import { Row, Col, Container } from 'reactstrap'
import logo  from '../res/mainelements/logo_white_text.png';
import tv  from '../res/saaranglogo/television.svg';
import cam from '../res/saaranglogo/camera.svg';

class AboutComponent extends React.Component {
  render() {
    return <div className="cont" >

      <img className="img1" src= {cam} height= "30%" width = "30%"  />
      <img src= { logo } height = '60%' width = '60%' />
      <img className="img1" src= {tv} height= "30%" width = "30%"  />

    </div>
  }
}

export default AboutComponent
